import React from 'react';
import '../style/style.css';  // Ensure the path is correct
import '../style/shop.css';  // Ensure the path is correct

const BrandAmbassador = () => {
  return (
    <div id="brand-back-img">
      <div className="page_width">
        <div className="backgourn-wrapper">
          <img src="img/back4.webp" alt="back4" />
        </div>
        <div className="backgourn-wrapper">
          <img src="img/backmapimg.webp" alt="back4" />
        </div>
        <div className="backgourn-wrapper">
          <img src="img/backgold.webp" alt="back4" />
        </div>
      </div>
    </div>
  );
};

export default BrandAmbassador;
